import React, { useState } from 'react';
import axios from 'axios';
import './RegistrationForm.css'; // Import the new CSS file
import AAPLlogo from '../assets/img.png'; // Update this with the correct path
import logo from '../assets/img1.jpeg'; // Update this with the correct path

const RegistrationForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    place: '',
    phone: '',
    source: '',
    members: '',
    occupation: '',
    age: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:4000/api/customers', formData);
      alert('Form submitted successfully!');
      setFormData({
        name: '',
        place: '',
        phone: '',
        source: '',
        members: '',
        occupation: '',
        age: ''
      });
    } catch (error) {
      alert('Error submitting form');
    }
  };

  return (
    <div className="form-container">
      <header className="header">
        <img src={AAPLlogo} alt="Header" className="header-image" />
        <div className="logo-container">
          <img src={logo} alt="Logo" className="header-logo" />
        </div>
        <div className="header-middle">
          <h5>IBIZ Registration Form</h5>
        </div>
      </header>
      <form onSubmit={handleSubmit} className="registration-form">
        <label>
          Name:
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            required
          />
        </label>
        <label>
          Place:
          <input
            type="text"
            name="place"
            value={formData.place}
            onChange={handleChange}
            required
          />
        </label>
        <label>
          Phone No:
          <input
            type="text"
            name="phone"
            value={formData.phone}
            onChange={handleChange}
            required
          />
        </label>
        <label>
          Age:
          <input
            type="number"
            name="age"
            value={formData.age}
            onChange={handleChange}
            required
          />
        </label>
        <label>
          Where you got to know about IBiz:
          <select
            name="source"
            value={formData.source}
            onChange={handleChange}
            required
          >
            <option value="">Select</option>
            <option value="Social Media">Social Media</option>
            <option value="Friend">Friend</option>
            <option value="Advertisement">Advertisement</option>
            <option value="Event">Event</option>
          </select>
        </label>
        <label>
          Members with you:
          <input
            type="number"
            name="members"
            value={formData.members}
            onChange={handleChange}
            required
          />
        </label>
        <label>
          Occupation:
          <select
            name="occupation"
            value={formData.occupation}
            onChange={handleChange}
            required
          >
            <option value="">Select</option>
            <option value="Student">Student</option>
            <option value="Engineer">Engineer</option>
            <option value="Doctor">Doctor</option>
            <option value="Teacher">Teacher</option>
          </select>
        </label>
        <button type="submit" className="submit-btn">
          Submit
        </button>
      </form>
    </div>
  );
};

export default RegistrationForm;
